      "  keywords: Linguistics;Indexes;Optimization;Linear programming;Additives;Numerical models;Mathematical model;linguistic terms;hesitant fuzzy linguistic preference relations;consistency\n",
      "  abstract: Hesitant fuzzy linguistic preference relation (HFLPR) is an utilitarian tool to capture diverse information from decision makers under uncertain situations. How to improve the unacceptable consistency level for HFLPR is a key issue to guarantee the reliability of the decision information. This paper introduces the worst consistency index for HFLPRs to judge the logic of DMs in the worst case. Under the purpose of minimizing the amount of modification, an optimization model is constructed to achieve an acceptable worst consistency level for a HFLPR. A linear programming model is established to reduce the difficulty of solving the presented optimization model. It ensures the consistency indices related to all the possible linguistic preference relations (LPRs) from a given HFLPR meet the predefined consistency level requirement. Finally, the proposed model is applied to a numerical example to show it's significance.\n",
