      "  keywords: Semantics;Cryptography;Information management;Data mining;Protocols;data understanding;information management;computational intelligence;data security\n",
      "  abstract: In this paper will be described the way of using data understanding techniques for semantic information extraction and data meaning evaluation. Extracted information may be then used for performing some management tasks and security actions. It may play important role in advanced secure management applications and intelligent access control to secure data. Such techniques allow extending security procedures and have a great influence for creation new areas of security like personalized cryptography.\n",
