      "  keywords: Social network services;Internet;Media;Erbium;Tools;Atmospheric measurements;Particle measurements;computational propaganda;participatory propaganda;digital technologies;social media networks;Internet propaganda\n",
      "  abstract: The article analyzes the efficiency criteria that underlie on a number of theoretical and methodological approaches. The history of this research question goes back more than a decade. At the same time, the conditions of the digital environment require a transformation of the evaluation effectiveness of propaganda content. Also, it has a connection with the peculiarities of communication processes in the Internet space.\n",
