      "  issn: 1947-1491\n",
      "  doi: 10.1109/APS.2011.5996554\n",
      "  keywords: Education;Software;Smart phones;Time domain analysis;Time varying systems;Arrays;Electronic learning;Computational electromagnetics;Mobile computing;TLM\n",
      "  abstract: A novel pedagogical approach to the teaching of wave phenomena is presented. The growing popularity of smartphones is exploited to provide students with a personal, mobile modelling environment based on the Transmission Line matrix method (TLM). This supports material delivered by more traditional means. There are opportunities for features of the mobile device, together with the software delivery mechanism, to guide students through different levels of complexity in the teaching. This would allow the software on the device to give an accessible, hands-on experience to the students. No significant access to external computing resources is required, limiting the amount of data traffic generated by the use of the software. An initial proof of concept example is described with suggestions for development into a full learning framework.\n",
      "  pages: 1401-1404\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2011\n",
      "  title: A Framework for teaching electromagnetic concepts using mobile devices\n",
      "  booktitle: 2011 IEEE International Symposium on Antennas and Propagation (APSURSI)\n",
      "  author: Browne, Daniel R. and Pomeroy, Simon C. and Flint, James A.\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 5996554\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Dec\n",
      "  issn: 2473-7569\n",
      "  doi: 10.1109/FIT60620.2023.00058\n",
      "  keywords: Deep learning;Measurement;Linguistics;Writing;Transformers;Probabilistic logic;Natural language processing;urdu poetry generation;natural language processing;deep learning;transformers;computational linguistics\n",
      "  abstract: Poetry generation is a branch of text generation that demands a high level of linguistic proficiency and creativity. The Urdu language, renowned for its rich poetic tradition, encompasses a diverse collection of poets, each possessing a unique writing style. This research explores the automatic generation of Urdu poetry, specifically Urdu ghazals which hold a significant cultural value using natural language processing (NLP) techniques including deep learning. The dataset used consists of 17,609 couplets from the works of 15 renowned Urdu ghazal poets. We use three different approaches for poetry generation which include (a) the n-gram probabilistic model, (b) deep learning models such as LSTM and GRU, and (c) the state-of-the-art GPT-2 model. BLEU scores for each of these were (a) 0.5 for the n-gram model, (b) 0.1 for LSTM and GRU and, (c) 0.6 for the GPT-2 model, which was the highest overall score. In addition to the BLEU score, other metrics such as rhyming score and human evaluation were considered for evaluating the generated poetry. This research is the first to use transformer-based models for Urdu poetry generation, which enables aspiring poets to learn from and be inspired by the rich tradition of Urdu poetry.\n",
      "  pages: 280-285\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2023\n",
      "  title: Generation of Urdu Ghazals using Deep Learning\n",
