      "  author: Fahim, Saad and Siddiqui, Iqra and Pervez, Sameer and Kumar, Sandesh and Alvi, Faisal and Samad, Abdul\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 10410390\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
