      "  month: Oct\n",
      "  issn: 1944-9437\n",
      "  doi: 10.1109/RO-MAN46459.2019.8956448\n",
      "  keywords: Conferences;Software algorithms;Color;Software;Hardware;Robots\n",
      "  abstract: Computational thinking is a skill that is considered essential for the future generations. Because of this it should be incorporated into the curricula as soon as possible. An interesting option to work on computational thinking with children is by means of robots. Here, we present Robotito, a robot that can be programmed by arranging its environment, intended to help the development of computational thinking in preschool children. We describe its hardware and software environment, and hierarchical state machines used to implement two modes of interaction with environment-first based on color detection and the second sensible to the surrounding objects. We also present activities that we developed to work on abstraction, generalization, decomposition, algorithmic thinking, and debugging-skills related to computational thinking.\n",
      "  pages: 1-6\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2019\n",
      "  title: Designing child-robot interaction with Robotito\n",
      "  booktitle: 2019 28th IEEE International Conference on Robot and Human Interactive Communication (RO-MAN)\n",
      "  author: Bakała, Ewelina and Visca, Jorge and Tejera, Gonzalo and Seré, Andrés and Amorin, Guillermo and Gómez-Sena, Leonel\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 8956448\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Oct\n",
      "  issn: \n",
      "  doi: 10.1109/ICICEC62498.2024.10809018\n",
      "  keywords: Technological innovation;Accuracy;Sensitivity;Computational modeling;Magnetic resonance imaging;Sensitivity and specificity;Robustness;Computational efficiency;Convolutional neural networks;Dementia;dementia;CNN;MR Images;Deep Learning;Alzheimer’s diseases\n",
      "  abstract: Dementia is marked by a significant decline in cognitive abilities, surpassing typical age-related changes. This decline spans various cognitive domains, including memory, thinking, orientation, comprehension, calculation, learning, language, and judgment. In this study, we evaluated 15 Convolutional Neural Network (CNN) models that were trained to detect dementia using the OASIS (Open Access Series of Imaging Studies) dataset, which consists of MR images classified into four dementia categories. The densenet201 model outperformed the others, achieving an accuracy of 86.53%, with a sensitivity and specificity of 86.53% and 95.51%, respectively. Precision was recorded at 87.75%, with a false positive rate (FPR) of 4.49%, and an F1 Score of 86.27%. Furthermore, the Matthews Correlation Coefficient (MCC) was 82.54%, and the Kappa coefficient was 64.07%. Consequently, densenet201 stood out as the most effective model for dementia diagnosis from MR images, showcasing robust performance across various metrics.\n",
      "  pages: 1-5\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2024\n",
      "  title: Assessment of Convolutional Neural Networks for Dementia Diagnosis through MR Images\n",
      "  booktitle: 2024 First International Conference on Innovations in Communications, Electrical and Computer Engineering (ICICEC)\n",
