      "  issn: \n",
      "  doi: 10.1109/ICCNI.2017.8123792\n",
      "  keywords: Artificial intelligence;Games;Computers;Technological innovation;Face;Market research;Psychology;Alienation;Artificial Intelligence;Superintelligence AI's;Other Minds;Ontological theory;Marxian Alienation Theory\n",
      "  abstract: While most contemporary researchers argue that Artificial Intelligence (AI) provides overwhelming and profound advancements in technology and beneficial tools used daily to advance human life on earth, there exist a host of other researchers who hold contrary opinions to this view, with regard to the rising adverse ontological and existential consequences which the products of super-intelligent technologies has on an alarming number of mankind in the 21st century. Scholars like Vardi, Tegmark and Greene likened this scenario to a time-bomb waiting to go off any moment. The recent endorsement of 23 AI principles by 1200 AI/Robotics researchers and over 2342 other researchers from diverse disciplines, in a just concluded Future of Life (FLI) Conference, adds credence to the worries which most researchers have about the presumed benefits of AI to mankind. The study draws from a combination of Marxian Alienation and ontological theories which basically holds that: rising advancements in AI technologies, continues to alienate mankind from his existential human nature. The ex-post facto research design in the social sciences and Deriders' deconstructive and critical reconstructive analytic method in philosophy, for interrogating the meaning of concepts, arguments and current debates on the relevance and risks of IA, were adopted for the study. The study identified justifiable grounds and reasons for the alarm raised over current innovations in the field of AI technologies. The study strengthen the resolve of current researchers to identify ways of reducing or avoiding the impending adverse consequences of evolving conscious AI and machines in the feature. The research proposes a radical legal enforcement and adoption of the 23 newly established AI principles as one of the pertinent measure for saving mankind from the impending threats posed by innovations powered by advances in AI technology.\n",
      "  pages: 1-10\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2017\n",
      "  title: Artificial intelligence, alienation and ontological problems of other minds: A critical investigation into the future of man and machines\n",
      "  booktitle: 2017 International Conference on Computing Networking and Informatics (ICCNI)\n",
      "  author: Wogu, I. A. P. and Olu-Owolabi, F. E. and Assibong, P. A. and Agoha, B. C. and Sholarin, M. and Elegbeleye, A. and Igbokwe, D. and Apeh, H. A.\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 8123792\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Oct\n",
      "  issn: 1062-922X\n",
      "  doi: 10.1109/ICSMC.2003.1244654\n",
      "  keywords: Humans;Quantum computing;Distributed computing;Cognition;Machine intelligence;Quantum mechanics;Application software;Industrial psychology;Service robots;Computer industry\n",
      "  abstract: Human cognition stems from his identifying the relationship or relative distance between himself and any other objects or persons, for which prerequisite is establishing his 'self'. In other words, it is presumable that the potential of intelligent machine's establishing its 'self' would require us to engineer its sense of 'ego' and 'intention', which involves such factors as 'emotions', 'instincts', and 'sensibilities'. This dissertation introduces the psycho-quantum theory which illustrates the human psychodynamics by the quantum mechanics approach, and its application for constructing the distribution model of emotional modalities and the autonomous system, the essential elements for creating an ego in a computer. We have attempted to create the artificial 'ego' and 'desire' based on our probability model and state transition analysis, then accordingly developed our methodology of the artificial thought process as well as the judging mechanism of such computer. Furthermore, this dissertation introduces the sensibility inference function of our psycho-quantum computer, by which we discuss our methods to itemize 126 emotional modalities of human, construct the three-dimensional dynamic model of emotions, and analyze the emotion distribution and its longitudinal modal transition so as to derive the artificial instinct and to determine/infer its relationship with external factors. Currently, our technology to construct the comprehensive psycho-quantum computer is yet in developmental stage; however, its potential is enormous so that it will constitute a key technology in new robotics industry.\n",
      "  pages: 1679-1686 vol.2\n",
      "  number: \n",
      "  volume: 2\n",
      "  year: 2003\n",
      "  title: The sensibility inference function by psycho-quantum computer\n",
      "  booktitle: SMC'03 Conference Proceedings. 2003 IEEE International Conference on Systems, Man and Cybernetics. Conference Theme - System Security and Assurance (Cat. No.03CH37483)\n",
      "  author: Mitsuyoshi, S. and Fuji Ren\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 1244654\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Oct\n",
      "  issn: 2837-5025\n",
      "  doi: 10.1109/WEEF-GEDC59520.2023.10343639\n",
      "  keywords: Training;Systematics;Philosophical considerations;Collaboration;Chatbots;Problem-solving;Stakeholders;AI chatbots;engineering education;risks;challenges;systematic review;artificial intelligence;pedagogy;ethics;technological limitations;socio-cultural implications\n",
      "  abstract: The educational system's trajectory has shifted dramatically in recent years. The introduction of chatbots and artificial intelligence (AI) techniques has mostly pushed the trend. Fundamentally, these methods are intended to improve the culture and experience of teaching and learning. However, there are risks associated with these technologies. The risks of using AI chatbots in the education of future engineering graduates are severely examined in this systematic review. This review identifies and addresses pedagogical, ethical, technological, and socio-cultural dangers that may come from the widespread use of AI chatbots based on an intensive review of the available research. The findings provide useful insights for educators, institutions, and policymakers as they manage the hurdles of implementing AI chatbots in engineering education responsibly.\n",
      "  pages: 1-6\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2023\n",
      "  title: The Risks Associated with AI Chatbots in Teaching Future Engineering Graduates: A Systematic Review\n",
      "  booktitle: 2023 World Engineering Education Forum - Global Engineering Deans Council (WEEF-GEDC)\n",
      "  author: Moloi, K. and Maladzhi, R. W. and Nemavhola, F. J. and Mthombeni, N. H. and Tsoeu, M. S. and Mashifana, T.\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 10343639\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Aug\n",
      "  issn: 1556-6048\n",
      "  doi: 10.1109/MCI.2013.2264573\n",
      "  keywords: Artificial intelligence;Robots;Cognition;Service robots;Production facilities;Smart phones;Personal digital assistants\n",
      "  abstract: The ability to think has been one of the most fascinating features of robots in science fiction since the introduction of the word 'robot' by Karel Capek in his Czech science fiction play, known as 'Rossum's Universal Robots' in English [1]. Since Capek's first depiction in 1921, science fictionists generally portray robots as intelligent humanoid machines that are subservient to humans. Android is another term used for such robots in modern linguistics. However, the development of robots with the ability to think has largely been a fantasy for robot scientists and engineers. Nevertheless, the evolution of robots has come a long way since the first industrial robot 'Unimate' in 1954. Robots have transformed from large automated manufacturing facilities to applications in our homes and even into our pockets as software robots in our PDAs and smart phones [2], [3]. This paper classifies robot intelligence into six categories: cognitive intelligence, social intelligence, behavioral intelligence, ambient intelligence, collective intelligence and genetic intelligence. This classification categorizes the intelligence of robots based on the different aspects of awareness and the ability to act deliberately as a result of such awareness.\n",
      "  pages: 70-84\n",
      "  number: 3\n",
      "  volume: 8\n",
      "  year: 2013\n",
      "  title: Intelligence Technology for Robots That Think [Application Notes]\n",
      "  journal: IEEE Computational Intelligence Magazine\n",
      "  author: Kim, Jong-Hwan and Choi, Seung-Hwan and Park, In-Won and Zaheer, Sheir Afgen\n",
      "  ENTRYTYPE: article\n",
      "  ID: 6557108\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Sep.\n",
      "  issn: 1943-6106\n",
      "  doi: 10.1109/VLHCC.2012.6344492\n",
      "  keywords: Visualization;Games;Semiotics;Programming;Marine animals;Interviews;Inspection;computational thinking;end-user programming;visual programming;cognitive dimentions of notations;semiotic engineering methods\n",
      "  abstract: Using game design and programming to foster computational thinking acquisition has proved to be a successful strategy in recent years. In previous research with AgentSheets, we concluded that the semiotic richness of this visual programming environment, specifically designed to support computational thinking acquisition, could be explored more extensively to the benefit of learners. In particular, we realized that there are some additional representations of AgentSheets games and simulations that are not presented as programming tools in the interface, and yet they communicate new relevant meanings to the users. This paper reports on research where we artificially introduced such representations in a small follow-up experiment with selected participants from our previous research experiment. Our goal was to investigate the impact of such additional representations on program comprehension and modification tasks. To this end we contrasted empirical evidence of their performance in the two tasks with their verbal account of experience with AgentSheets. We used a combination of discourse analysis and inspections using Semiotic Engineering methods and the Cognitive Dimensions of Notations framework. Our findings go in two directions. First, we observed that additional representations have allowed participants to expand and correct previous learning. Therefore such representations can support new teaching strategies in computational thinking acquisition programs with AgentSheets. Second, we learned that the combination of methods we used to analyze empirical data - discourse analysis with semiotic and cognitive inspection techniques - can be used systematically in other research contexts, holding the promise of insightful results.\n",
      "  pages: 101-108\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2012\n",
      "  title: Combining cognitive, semiotic and discourse analysis to explore the power of notations in visual programming\n",
      "  booktitle: 2012 IEEE Symposium on Visual Languages and Human-Centric Computing (VL/HCC)\n",
      "  author: Ferreira, Juliana J. and de Souza, Clarisse S. and de Castro Salgado, Luciana C. and Slaviero, Cleyton and Leitão, Carla F. and Moreira, Fábio de F.\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 6344492\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Sep.\n",
      "  issn: \n",
      "  doi: 10.1109/ICAICTA49861.2020.9429039\n",
      "  keywords: User centered design;Education;Games;Serious games;Usability;Informatics;Testing;computational thinking;Bebras;serious games;interaction design;user-centered;effective;easy to learn;enjoyable\n",
      "  abstract: Computational thinking education nowadays gets more attention around the world because of its importance. In Indonesia, computational thinking has not received attention as much as in other developed countries. However, there is a community that already focuses on promoting computational thinking to Indonesian students through annual competitions, which is Bebras Indonesia. The problems that are used in the competition also have been adapted into a game. The game aims to help student practicing for the competition, but the game still has several limitations to be used by Indonesian students. Therefore, this paper researches similar games design interaction that suits Indonesian students, particularly for upper elementary school students. The type of the game is a serious game that has the main goal of learning. An approach of user-centered design was used to develop the design interaction. Usability testing was conducted to verify the result of the design interaction in two iterations. The result of the research shows that the design interaction is effective with a score of completion rate of 100% and easy to learn with a score of SEQ 6,37 out of 7. It is also enjoyable for students based on the result of the E-Gameflow questionnaire score of 5,83 out of 7 and an IMI enjoyability score of 5,77 out of 7.\n",
      "  pages: 1-6\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2020\n",
      "  title: Designing “Bebras” Serious Games Interaction for Indonesian Upper Elementary School Students\n",
      "  booktitle: 2020 7th International Conference on Advance Informatics: Concepts, Theory and Applications (ICAICTA)\n",
      "  author: Aslina, Yasya Rusyda and Mulyanto, Adi and Niwanputri, Ginar Santika\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 9429039\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: May\n",
      "  issn: \n",
      "  doi: 10.1109/ICCICA60014.2024.10585049\n",
      "  keywords: Support vector machines;Deep learning;Radio frequency;Accuracy;Computational modeling;Predictive models;Brain modeling;Parkinson’s disease;k-nearest neighbour;machine learning;deep learning;neural networks;random forest;decision tree\n",
      "  abstract: The human nervous system is the controlling mechanism for coordinating all body-related activities. In the cognitive world, it stimulates thinking capabilities. It prompts a reaction to a particular situation and allows body parts to move. In addition, it also regulates other physiological functions such as digestion and respiration. The nervous system consists of billions of cells which interpret information from sensory elements and translate it into coordinated action performed by various parts of the body. With the increase in age, the steady decline of these cells results in a loss of dopamine compounds. Parkinson's disease (PD) is caused by an unforeseen expansion of the movement of bodily extremities that results in this decline. Finding a cure for this disease is still an enormous challenge, and its progression can be slowed by early detection. The proposed work has been implemented with seven machine learning and deep-learning techniques, including decision tree (DT), random forest (RF), logistic regression, naive Bayes, k nearest neighbour, neural network model, and support vector machines for preemptively predicting PD. The model was implemented utilizing a dataset acquired from Kaggle. This included the normal cases as well as those with PD. The findings showed that the random forest model was superior to others, achieving an accuracy of 86.70%. In contrast, the naive Bayes model displayed the lowest accuracy of 71.50%. In addition, both the random forest and support vector machine models showed the highest accuracy levels of 85.90%. Various other performance metrics such as computational time, AUC (the Area Under the Curve), F1-score, ROC curve area, and recall rate were utilized to predict the effectiveness of each technique. Comparative analysis identified that the least performing models are the k-nearest neighbour and naive Bayes methods. In the future, this method can be refined further by using a large dataset and employing deep learning models for higher predictive outcomes.\n",
      "  pages: 154-159\n",
      "  number: \n",
      "  volume: 1\n",
      "  year: 2024\n",
      "  title: An Early Detection of Parkinson’s Disease using Machine Learning and Deep Learning Models\n",
      "  booktitle: 2024 International Conference on Computational Intelligence and Computing Applications (ICCICA)\n",
      "  author: Sharma, Shagun and Guleria, Kalpna and Sobti, Rajni\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 10585049\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Dec\n",
      "  issn: 2771-7453\n",
      "  doi: 10.1109/AIVR56993.2022.00027\n",
      "  keywords: Solid modeling;Emotion recognition;Computational modeling;Virtual reality;User experience;Appraisal;Behavioral sciences;virtual humans;emotion generation;appraisal theory;behavior modeling\n",
      "  abstract: Affective interaction with virtual humans can enhance the quality of user experience in virtual reality. It takes place through various considerations such as emotional representation in their behavioral patterns, facial expressions, head pose, body stance, and so on. Deciding on the emotional state of a virtual human at a moment, however, is still a challenge. Computational models of emotion, stemming from appraisal theories, are suggested for modeling emotion in virtual agents. Despite their competence in extracting emotion from appraisal values, they are poorly defined in describing how to assess appraisal values within a sense-think-act behavior model. Motivated by this lack of empirical knowledge on the appraisal stage, in this preliminary work, we propose a framework to bridge the gap between a computational model of emotion and a behavior model of virtual humans. To this end, we use a need-based, goal- oriented, autonomous behavior model to generate salient stimuli for eliciting emotions. Our simulation of a case study suggests that the proposed framework can produce sensible emotional states that conform to the essential principles of appraisal-based emotion theories.\n",
      "  pages: 135-139\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2022\n",
      "  title: The Design and Development of a Goal-Oriented Framework for Emotional Virtual Humans\n",
      "  booktitle: 2022 IEEE International Conference on Artificial Intelligence and Virtual Reality (AIVR)\n",
      "  author: Roohi, Samad and Skarbez, Richard\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 10024444\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: May\n",
      "  issn: 1948-3554\n",
      "  doi: 10.1109/NER49283.2021.9441407\n",
      "  keywords: Neuroscience;Computational modeling;Biological system modeling;Neurons;Laboratories;Education;Neural engineering\n",
      "  abstract: Neuroscience is a highly interdisciplinary field, but more collaboration among STEM disciplines is needed to advance undergraduate neuroscience education. This paper reports the development of code-based virtual laboratories to cross-foster ideas from engineering and biology in the neuroscience classroom. The simulations use a combination of NEURON and Python code to model neurophysiological processes. We report that the use of computational tools in the classroom increases student self-reported comfort in participating in a computational research project. The tools we developed have potential to increase persistence and retention of undergraduate students by encouraging interdisciplinary thinking and reducing barriers to entry.\n",
      "  pages: 738-741\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2021\n",
      "  title: Multi-platform simulations facilitate interdisciplinary instruction in undergraduate neuroscience\n",
      "  booktitle: 2021 10th International IEEE/EMBS Conference on Neural Engineering (NER)\n",
      "  author: Donley, David W. and Chen, Ziao and Bergin, David and Schulz, David J. and Nair, Satish S\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 9441407\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Aug\n",
      "  issn: 2473-9464\n",
      "  doi: 10.1109/ICCSE51940.2021.9569362\n",
      "  keywords: Analytical models;Data analysis;Computational modeling;Education;Tools;Data models;Cognition;Active learning strategy;Data analytics;Python language;Curricula model\n",
      "  abstract: The programming language Python is simple and easy to learn and is used for students with no prior background in programming. Several colleges and universities teach Python to students who are learning a programming language for the first time. In this paper, we present a curricular model for introducing, through active learning strategies, data analytics concepts and applications into an introductory computer science course for non-majors. We have designed the course to use a variety of hands-on laboratory projects that use the Python programming language and associated tools. While introducing students to an important research area, we believe the use of these projects improves students’ learning experiences, enables them to apply and relate fundamental computational thinking concepts of algorithmic reasoning, data representation, and computational efficiency to data analytics problems. Assessment results show that introducing data analytics concepts and applications through active learning strategies enhanced students’ computing capability to solve problems.\n",
      "  pages: 301-306\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2021\n",
      "  title: Active Learning Strategies: A Computing Course for Undergraduates\n",
      "  booktitle: 2021 16th International Conference on Computer Science & Education (ICCSE)\n",
      "  author: Duan, Zhuojun and Russell, Ingrid and Jung, Andrew\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 9569362\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Oct\n",
      "  issn: 2377-634X\n",
      "  doi: 10.1109/FIE58773.2023.10343516\n",
      "  keywords: COVID-19;Visualization;Pandemics;Computational modeling;Education;Writing;SPICE;electronics lab;system thinking;reverse engineering;project based learning\n",
      "  abstract: This practice work-in-progress paper describes an innovative laboratory course designed to introduce a heterogenous cohort of undergraduate students from various fields of engineering and science to the principles of designing and analyzing complex electronic systems. The course utilizes a self-developed drum machine as a visual and acoustic project with a gradually increasing level of complexity throughout the lab sessions. Through active participation students acquire an understanding of SPICE simulations, test & measurement equipment, and printed circuit board (PCB) assembly. The course is mandatory for students pursuing a bachelor's degree in electrical, mechatronic, biomedical, computational, and information system engineering, and is also attended as an optional module by computer science and physics students. In the winter term of 2022, the course returned to the lab after the COVID-19 pandemic and was attended by more than 200 students. The laboratory experiments are supported by complementary activities, such as SPICE simulations of the circuits as preparation, and lab reports written in LaTeX to introduce the students to scientific writing. Instructional videos and consultation hours are offered to assist with SPICE simulation and LaTeX. During the physical lab sessions, students work in groups of three in a traditional laboratory environment, with student tutors available to provide guidance offered in the form of minimal help. Overall, the presented lab course is an innovative and engaging method of teaching electronic systems. The self-developed drum machine provides a visually and audibly stimulating project, allowing students to learn practical skills and develop their theoretical knowledge.\n",
      "  pages: 1-5\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2023\n",
      "  title: From breadboard to complex electronic systems - introducing a heterogenous group of undergrad students to design and analysis of electronic circuits\n",
      "  booktitle: 2023 IEEE Frontiers in Education Conference (FIE)\n",
      "  author: Riehl, David and Keil, Ferdinand and Hofmann, Klaus\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 10343516\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: July\n",
      "  issn: \n",
      "  doi: 10.1109/ICCI-CC.2017.8109742\n",
      "  keywords: Support vector machines;Kernel;Feature extraction;Design automation;Image enhancement;Liver;Hepatocellular carcinoma (HCC);Computational Intelligence;Machine Learning;Computer aided diagnosis (CAD);Wavelet Transform (WT);Support Vector Machines (SVM)\n",
      "  abstract: Image processing plays a vital role in the early detection and diagnosis of Hepatocellular Carcinoma (HCC). In this paper, we present a computational intelligence based Computer-Aided Diagnosis (CAD) system that helps medical specialists detect and diagnose HCC in its initial stages. The proposed CAD comprises the following stages: image enhancement, liver segmentation, feature extraction and characterization of HCC by means of classifiers. In the proposed CAD framework, a Discrete Wavelet Transform (DWT) based feature extraction and Support Vector Machine (SVM) based classification methods are introduced for HCC diagnosis. For training and testing, the recorded biomarkers and the associated imaging data are fused. The classification accuracy of the proposed system is critically analyzed and compared with state-of-the-art machine learning algorithms. In addition, laboratory biomarkers are also used to cross-validate the diagnosis.\n",
      "  pages: 139-145\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2017\n",
      "  title: Machine learning based computer-aided diagnosis of liver tumours\n",
      "  booktitle: 2017 IEEE 16th International Conference on Cognitive Informatics & Cognitive Computing (ICCI*CC)\n",
      "  author: Ali, Liaqat and Khelil, Khaled and Wajid, Summrina K. and Hussain, Zain U. and Shah, Moiz A. and Howard, Adam and Adeel, Ahsan and Shah, Amir A. and Sudhakar, Unnam and Howard, Newton and Hussain, Amir\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 8109742\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Jan\n",
      "  issn: 1941-0506\n",
      "  doi: 10.1109/TVCG.2017.2745878\n",
      "  keywords: Data visualization;Education;Visualization;Algorithm design and analysis;Creativity;Computational modeling;Explanatory visualization;Information Visualization;Teaching visualization;Learning Support\n",
      "  abstract: Visualizations are nowadays appearing in popular media and are used everyday in the workplace. This democratisation of visualization challenges educators to develop effective learning strategies, in order to train the next generation of creative visualization specialists. There is high demand for skilled individuals who can analyse a problem, consider alternative designs, develop new visualizations, and be creative and innovative. Our three-stage framework, leads the learner through a series of tasks, each designed to develop different skills necessary for coming up with creative, innovative, effective, and purposeful visualizations. For that, we get the learners to create an explanatory visualization of an algorithm of their choice. By making an algorithm choice, and by following an active-learning and project-based strategy, the learners take ownership of a particular visualization challenge. They become enthusiastic to develop good results and learn different creative skills on their learning journey.\n",
      "  pages: 791-801\n",
      "  number: 1\n",
      "  volume: 24\n",
      "  year: 2018\n",
      "  title: The Explanatory Visualization Framework: An Active Learning Framework for Teaching Creative Computing Using Explanatory Visualizations\n",
      "  journal: IEEE Transactions on Visualization and Computer Graphics\n",
      "  author: Roberts, Jonathan C. and Ritsos, Panagiotis D. and Jackson, James R. and Headleand, Christopher\n",
      "  ENTRYTYPE: article\n",
      "  ID: 8017594\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Oct\n",
      "  issn: \n",
      "  doi: 10.1109/FIE.2015.7344113\n",
      "  keywords: Computers;Programming profession;Engineering profession;Conferences;Education;Computing;21C Learning;Programming;Scratch;Computational thinking;Collaborative learning\n",
      "  abstract: Women are underrepresented in the field of Computer Science. This project aims to help Secondary School girls develop an insight into the role computers play in society and to learn some of the key skills in computing including computer programming. Exposure to Computer Science, in home or school environments, and encouragement from family and peers are leading factors that influence girls' decisions to pursue careers in Computer Science. Other factors include the girls' perception of their own problem solving ability, an understanding of the diverse applications of Computer Science and related career paths and the potential for positive social impact. This paper describes the design of an after school computing programme, CodePlus, which uses a novel 21st Century learning model. Pre and post questionnaire are being used to explore girls intentions to study CS, their confidence to study CS, perception of CS as a career, gender perception of CS and IT profession and self-efficacy following participation in the CodePlus programme. Preliminary results comparing pre questionnaire results with a male control group highlight differences in how girls see themselves in terms of CS capabilities and their future potential. Initial post questionnaire findings show a significant increase in the participants' perceived programming ability.\n",
      "  pages: 1-5\n",
      "  number: \n",
      "  volume: \n",
      "  year: 2015\n",
      "  title: CodePlus — Designing an after school computing programme for girls\n",
      "  booktitle: 2015 IEEE Frontiers in Education Conference (FIE)\n",
      "  author: Sullivan, K. and Byrne, J. R. and Bresnihan, N. and O'Sullivan, K. and Tangney, B.\n",
      "  ENTRYTYPE: inproceedings\n",
      "  ID: 7344113\n",
      "----------------------------------------\n",
      "Registro único agregado:\n",
      "  Registro:\n",
      "  month: Oct\n",
      "  issn: 2377-634X\n",
