      "  keywords: Robot sensing systems;Debugging;Programming profession;Education;robotics;computational thinking;K-12\n",
      "  abstract: The impact of technology on workforce development and socioeconomic prosperity has made K-12 computing engineering and STEM in general a national educational priority. However, the integration of computing remains obstructed by resources and lack of professional development to support students' learning. Further challenging is students' STEM attitudes and interest do not matriculate with them into higher education. This issue is especially critical for traditionally under represented and underserved populations including females, racial/ethnic minority groups, and students of low-socioeconomic status (SES). To help mitigate challenges, we developed an unplugged (computer-less) computing engineering and robotics lesson composed of two introductory computing concepts, sequencing and decision-making, using a small robot arm and tangible programming blocks. Through students' sequencing of operations, debugging, and executing complex robotic behavior, we seek to determine if students' interest or attitudes change toward engineering. Nine one-hour introductory pilot lessons with 148 students, grades 6-10, at two public middle schools, and one summer camp were conducted. We measured students' engineering interest and attitudes through a 15 question pre- and post-lesson survey and calculated aggregate factor scores for interest and attitudes. We found low-SES students' a priori interests and attitudes tend to be lower and more varied than those of their high-SES peers. These preliminary results suggest that the integration of introductory computing and robotics lessons in low-SES classrooms may help students reach similar levels of engineering interest and attitudes as their high-SES peers.\n",
