    "df_publisher_filtrado = df_limpio1[~df_limpio1['Publisher'].isin(valores_invalidos)]\n",
    "\n",
    "# --- 3. Contar los 15 publishers con más apariciones ---\n",
    "publisher_counts = df_publisher_filtrado['Publisher'].value_counts().head(15)\n",
